[package]
name = "googleapis-tonic"
version = "0.41.0"
authors = ["bouzuya <m@bouzuya.net>"]
description = "A Google APIs client library generated by tonic-build"
edition = "2021"
keywords = ["api", "gcloud", "gcp", "google", "tonic"]
license = "MIT OR Apache-2.0"
repository = "https://github.com/bouzuya/googleapis-tonic"

[dependencies]
prost = "0.13.4"
prost-types = "0.13.4"
tonic = { version = "0.12.3", default-features = false, features = [
  "codegen",
  "prost",
] }

[lints.clippy]
doc_lazy_continuation = "allow"
large_enum_variant = "allow"
module_inception = "allow"
non_minimal_cfg = "allow"

[lints.rust]
unused_imports = "allow"

[features]
btree-map = []
bytes = []
cloud-kubernetes-security-containersecurity_logging = []
default = [hash-map, vec-u8]
google-actions-sdk-v2 = [google-actions-sdk-v2-conversation, google-actions-sdk-v2-interactionmodel, google-actions-sdk-v2-interactionmodel-prompt, google-actions-sdk-v2-interactionmodel-type, google-api, google-rpc, google-type]
